Answer: A DFA is infinite if it has a cycle that can be traversed infinitely. To check for this, a simple algorithm can be used:

1.  Start at the initial state.
2.  Mark the current state as visited.
3.  For each transition from the current state, if the next state has not been visited, recursively apply the algorithm to the next state.
4.  If a state is reached that has already been visited, and the path from the initial state to this state contains a cycle, then the DFA is infinite.

Here is a simple implementation in Python:

```python
def is_infinite(dfa):
    visited = set()
    recursion_stack = set()

    def is_infinite_helper(state):
        visited.add(state)
        recursion_stack.add(state)

        for symbol in dfa.alphabet:
            next_state = dfa.transition_function[state][symbol]
            if next_state not in visited:
                if is_infinite_helper(next_state):
                    return True
            elif next_state in recursion_stack:
                return True

        recursion_stack.remove(state)
        return False

    return is_infinite_helper(dfa.initial_state)

