To ensure that this effect only runs once every 0.6 seconds, you can use a technique called "debouncing". Debouncing is a programming technique that prevents a function from being executed too many times in a short period of time.

Here's an updated version of your code that uses debouncing to limit the execution of the effect to once every 0.6 seconds:
