**User Input in TypeScript**
=====================================

In TypeScript, a statically typed language, getting user input can be a bit tricky. However, with the help of the `prompt` function, we can achieve this. Below is an example of how to get user input in TypeScript.

**Using the `prompt` function**
-----------------------------

```typescript
// Get user input using prompt function
const userInput: string = prompt("Please enter your name: ");

// Print the user input
console.log("Hello, " + userInput);
```

**Using `readline` module**
---------------------------

If you're working in a Node.js environment, you can use the `readline` module to get user input.

```typescript
import * as readline from 'readline';

const rl = readline.createInterface({
  input: process.stdin,
  output: process.stdout
});

rl.question('Please enter your name: ', (answer) => {
  console.log(`Hello, ${answer}!`);
  rl.close();
});
```

**Using `prompt-sync` module**
-----------------------------

Alternatively, you can use the `prompt-sync` module, which provides a synchronous `prompt` function.

```typescript
import promptSync from 'prompt-sync';

const prompt = promptSync();

const userInput: string = prompt('Please enter your name: ');

console.log(`Hello, ${userInput}!`);
```

